function animate() {


  requestAnimationFrame(animate)
  c.clearRect(0, 0, canvas.width, canvas.height)
  myCats[0].draw();
  animate_iteration++;

  //0 for W (UP), 1 FOR A (LEFT), 2 for S (RIGHT), 3 for D (DOWN)
  //ACTION SELECTION & OBSERVATION -----------------------------------------------------------------------------

  let state_Index;   //THE CURRENT OBSERVATION
  let old_cat_distance;   //THE PREVIOUS DISTANCE from cat to mouse
  let new_cat_distance;   //THE NEW DISTANCE from cat to mouse
  let old_exit_distance;  //THE PREVIOUS DISTANCE from exit to mouse
  let new_exit_distance   //THE NEW DISTANCE from exit to mouse
  let action;    
  let row_incoming;
  let col_incoming;
  let old_mouse_row;
  let old_mouse_col;
  let old_cat_row;
  let old_cat_col;
  let player_position_update = false;
  let player_observed = false;

  //reset
  if(restart) {
    restart = false;
    myCats[0].rows = [];
    myCats[0].col = [];
    player.future_row = -2;
    player.future_col = -2;
  }
  if(restart2) {
    restart2 = false;
    myCats[0].rows = [];
    myCats[0].col = [];
    player.future_row = -2;
    player.future_col = -2;
  }

  if(animate_iteration % UPDATE_FREQUENCY == 0) {

    if(check_edge_case) {
      //checking for illegal moves.
      old_mouse_row = get_discrete_Y(player.position.y);
      old_mouse_col = get_discrete_X(player.position.x);
      old_cat_row = get_discrete_Y(myCats[0].position.y);
      old_cat_col = get_discrete_X(myCats[0].position.x);
    }

    if(!player.movement_in_progress || player.future_row === -2) {
      observed_frequency += 1;
      player_observed = true;
        if(myCats[0].rows.length === 0) {
          //FIRST ITERATION SO WE HAVE TO CREATE THE INITIAL OBSERVATION
          my_matrix = read_write_values(map)
          fastestTimes(my_matrix, get_discrete_Y(myCats[0].position.y), get_discrete_X(myCats[0].position.x), get_discrete_Y(player.position.y), get_discrete_X(player.position.x), myCats[0].rows, myCats[0].col)
        }

        // if(myCats[0].rows.length !== 0) {
          //determine the direction in which the cat is coming from.
        if(myCats[0].rows.length === 2) {
          row_incoming = get_discrete_Y(myCats[0].position.y);
          col_incoming = get_discrete_X(myCats[0].position.x);
        }
        else {
          row_incoming = myCats[0].rows[myCats[0].rows.length - 3];
          col_incoming = myCats[0].col[myCats[0].col.length - 3];
        }
        let mouse_row = get_discrete_Y(player.position.y);
        let mouse_col = get_discrete_X(player.position.x);

        let direction = getCatDirection(mouse_row, mouse_col, row_incoming, col_incoming)

        state_Index = getStateIndex(mouse_row, mouse_col, direction, myCats[0].rows.length)
        
        old_cat_distance = myCats[0].rows.length;
        old_exit_distance = newPathMatrix[mouse_row][mouse_col];

        //if we are not timed out AND testing, then get best action
        //if we are not testing AND epsilon is less than random then take best action.
        if (TESTING) {
          action = getBestAction(Qtable, state_Index);
          path_count += 1;    //counting number of paths mouse taken
        }

        if (TESTING && isOscillating(stateHistory, maxHistory)) {
          // Implement logic to handle oscillation, such as choosing a different action.
          action = getSecondBestAction(Qtable, state_Index);
        }

        if(saved_state_index !== null && state_Index === saved_state_index) {
          action = getSecondBestAction(Qtable, state_Index);
        }

        //-----------------------------------------------------------------------------

        if(check_escape(get_discrete_Y(player.position.y), get_discrete_X(player.position.x), action)) {
          //mouse has escaped
          restart2 = true;
        }

        if (action === 0) {
          for (let i = 0; i < boundaries.length; i++) {
          const boundary = boundaries[i]
          if (circleCollidesWithRectangle({
            circle: {
              ...player, 
              velocity: {
                x: 0,
                y: -player.my_velocity
              }
            },
            rectangle: boundary
            })
          ) {
            player.blockage = true;

            break
          } else {
            player.future_row = get_discrete_Y(player.position.y) - 1;
            player.future_col = get_discrete_X(player.position.x);
            player.blockage = false;
          }
          }
        }
        else if (action === 1) {
          for (let i = 0; i < boundaries.length; i++) {
          const boundary = boundaries[i]
          if (circleCollidesWithRectangle({
            circle: {
              ...player, 
              velocity: {
                x: -player.my_velocity,
                y: 0
              }
            },
            rectangle: boundary
            })
          ) {

            player.blockage = true;

            break
          } else {
            player.future_row = get_discrete_Y(player.position.y);
            player.future_col = get_discrete_X(player.position.x) - 1;
            player.blockage = false;
          }
          }
        }
        else if (action === 2) {
          for (let i = 0; i < boundaries.length; i++) {
          const boundary = boundaries[i]
          if (circleCollidesWithRectangle({
            circle: {
              ...player, 
              velocity: {
                x: 0,
                y: player.my_velocity
              }
            },
            rectangle: boundary
            })
          ) {
            // player.movement_in_progress = false;
            // player.velocity.y = 0
            player.blockage = true;
            //console.log("player blocked");
            break
          } else {
            player.future_row = get_discrete_Y(player.position.y) + 1;
            player.future_col = get_discrete_X(player.position.x);
            player.blockage = false;

          }
          }
        }
        else if (action === 3) {
          for (let i = 0; i < boundaries.length; i++) {
          const boundary = boundaries[i]
          if (circleCollidesWithRectangle({
            circle: {
              ...player, 
              velocity: {
                x: player.my_velocity,
                y: 0
              }
            },
            rectangle: boundary
            })
          ) {
            player.blockage = true;
            break
          } else {
            player.future_row = get_discrete_Y(player.position.y);
            player.future_col = get_discrete_X(player.position.x) + 1;
            player.blockage = false;
          }
          }
        }
      }

    }
    
  boundaries.forEach((boundary) => {
    boundary.draw()
    if (circleCollidesWithRectangle({
      circle: player,
      rectangle: boundary
    })) {
      // if(!player.movement_in_progress) {
      //   player.blockage = true;
      //   console.log("player blocked");
      // }
      player.blockage = true;
    }
  })

  //final goalkeeping to check if player goes out of bounds
  // if(player.future_row < 0 || player.future_row > map.length - 3 || 
  //   player.future_col < 0 || player.future_col > map.length - 3 || 
  //   pathLengthMatrix[player.future_row][player.future_col] === -2) {
  //   player.blockage = true;
  //   // console.log("blocked our future rows and columns");
  //   // console.log(player.future_row);
  //   // console.log(player.future_col);
  // }
  // else {
  //   console.log("NOT blocked our future rows and columns");
  //   console.log(player.future_row);
  //   console.log(player.future_col);
  // }

  if(animate_iteration % UPDATE_FREQUENCY === 0) {
    //player didn't get blocked and the mouse didn't escape yet
    if(!player.blockage && !restart2 && !restart) {
    direction_row = get_continuous_X(player.future_row) - player.position.y;
    direction_col = get_continuous_Y(player.future_col) - player.position.x;

    if (direction_row) {
        direction_row = direction_row > 0 ? 1 : -1;
    } else {
        direction_row = 0;
    }

    if (direction_col) {
        direction_col = direction_col > 0 ? 1 : -1;
    } else {
        direction_col = 0;
    }

    new_row = player.position.y + direction_row * VELOCITY;
    new_col = player.position.x + direction_col * VELOCITY;

    if (
    (new_row < get_continuous_X(player.future_row) && direction_row > 0) ||
    (new_row > get_continuous_X(player.future_row) && direction_row < 0) ||
    (new_col < get_continuous_Y(player.future_col) && direction_col > 0) ||
    (new_col > get_continuous_Y(player.future_col) && direction_col < 0)
    ) {
      player.movement_in_progress = true;
      go_to_row = get_continuous_X(player.future_row);
      go_to_col = get_continuous_Y(player.future_col);
      row_vector = go_to_row - player.position.y;
      col_vector = go_to_col - player.position.x;

      if(row_vector) {
        if(row_vector > 0) {
          player.position.y += VELOCITY;
        }
        else {
          player.position.y -= VELOCITY;
        }
      }
      else if(col_vector) {
        if(col_vector > 0) {
          player.position.x += VELOCITY;
        }
        else {
          player.position.x -= VELOCITY;
        }
      }
    }
    else if(
      (new_row >= get_continuous_X(player.future_row) && direction_row > 0) ||
      (new_row <= get_continuous_X(player.future_row) && direction_row < 0) ||
      (new_col >= get_continuous_Y(player.future_col) && direction_col > 0) ||
      (new_col <= get_continuous_Y(player.future_col) && direction_col < 0)
      )
      {
        go_to_row = get_continuous_X(player.future_row);
        go_to_col = get_continuous_Y(player.future_col);
        row_vector = go_to_row - player.position.y;
        col_vector = go_to_col - player.position.x;
        if(row_vector) {
          player.position.y = go_to_row;
        }
        else if(col_vector) {
          player.position.x = go_to_col;
        }
        player.movement_in_progress = false;
      }
    }
  }

  player.draw();

  for(let i = 0; i < myCats.length; i++) {
    myCats[i].draw();
  }

  if(animate_iteration % UPDATE_FREQUENCY === 0) {
    for(let i = 0; i < myCats.length; i++) {
      if(!restart && !restart2 && (myCats[i].rows.length !== 0) && (myCats[i].col.length !== 0) && (myCats[i].rows[myCats[i].path_iterations] !== -1) && (myCats[i].col[myCats[i].path_iterations] !== -1)) {
      
      //NOTE EACH CAT NEEDS IT'S OWN FRIGGIN UPDATE ITERATION


      cat_speed = VELOCITY;
      
      let direction_row = get_continuous_X(myCats[i].rows[myCats[i].path_iterations]) - myCats[i].position.y;
      let direction_col = get_continuous_Y(myCats[i].col[myCats[i].path_iterations]) - myCats[i].position.x;

      if (direction_row) {
          direction_row = direction_row > 0 ? 1 : -1;
      } else {
          direction_row = 0;
      }

      if (direction_col) {
          direction_col = direction_col > 0 ? 1 : -1;
      } else {
          direction_col = 0;
      }

      let new_row = myCats[i].position.y + direction_row * cat_speed;
      let new_col = myCats[i].position.x + direction_col * cat_speed;


      if (
      (new_row < get_continuous_X(myCats[i].rows[myCats[i].path_iterations]) && direction_row > 0) ||
      (new_row > get_continuous_X(myCats[i].rows[myCats[i].path_iterations]) && direction_row < 0) ||
      (new_col < get_continuous_Y(myCats[i].col[myCats[i].path_iterations]) && direction_col > 0) ||
      (new_col > get_continuous_Y(myCats[i].col[myCats[i].path_iterations]) && direction_col < 0)
      ) {
        myCats[i].movement_in_progress = true;
        let go_to_row = get_continuous_X(myCats[i].rows[myCats[i].path_iterations]);
        let go_to_col = get_continuous_Y(myCats[i].col[myCats[i].path_iterations]);
        let row_vector = go_to_row - myCats[i].position.y;
        let col_vector = go_to_col - myCats[i].position.x;

        if(row_vector) {
          if(row_vector > 0) {
            myCats[i].position.y += cat_speed;
          }
          else {
            myCats[i].position.y -= cat_speed;
          }
        }
        else if(col_vector) {
          if(col_vector > 0) {
            myCats[i].position.x += cat_speed;
          }
          else {
            myCats[i].position.x -= cat_speed;
          }
        }
      }
      else if(
      (new_row >= get_continuous_X(myCats[i].rows[myCats[i].path_iterations]) && direction_row > 0) ||
      (new_row <= get_continuous_X(myCats[i].rows[myCats[i].path_iterations]) && direction_row < 0) ||
      (new_col >= get_continuous_Y(myCats[i].col[myCats[i].path_iterations]) && direction_col > 0) ||
      (new_col <= get_continuous_Y(myCats[i].col[myCats[i].path_iterations]) && direction_col < 0)
      )
      {
        let go_to_row = get_continuous_X(myCats[i].rows[myCats[i].path_iterations]);
        let go_to_col = get_continuous_Y(myCats[i].col[myCats[i].path_iterations]);
        let row_vector = go_to_row - myCats[i].position.y;
        let col_vector = go_to_col - myCats[i].position.x;
        if(row_vector) {
          myCats[i].position.y = go_to_row;
        }
        else if(col_vector) {
          myCats[i].position.x = go_to_col;
        }
        myCats[i].movement_in_progress = false;
        myCats[i].path_iterations++;
      }
      
    }

      if(animate_iteration % 10 === 0) {
        myCats[i].go_flag = true;
      }

      if(animate_iteration === 1 || (myCats[i].go_flag && !myCats[i].movement_in_progress)) {
      //update CAT

      my_matrix = read_write_values(map)

      fastestTimes(my_matrix, get_discrete_Y(myCats[i].position.y), get_discrete_X(myCats[i].position.x), get_discrete_Y(player.position.y + 5), get_discrete_X(player.position.x + 5), myCats[i].rows, myCats[i].col)

      myCats[i].path_iterations = 0;

      myCats[i].go_flags = false;    //reset go_flag so we have to wait until the next iteration to update shortest path
    }
    }
    

    //CHECK IF PLAYER AND CAT ARE RIGHT NEXT TO EACH OTHER;
    if(checkCollisionAndRestart()) {
      restart = true;
    }

    if(check_edge_case) {
      if((get_discrete_Y(myCats[0].position.y) == old_mouse_row) && (get_discrete_X(myCats[0].position.x) == old_mouse_col) &&
        (get_discrete_Y(player.position.y) == old_cat_row) && (get_discrete_X(player.position.x) == old_cat_col)) {
          restart = true;
        }
    }


    if(areAdjacent(get_discrete_Y(myCats[0].position.y), get_discrete_X(myCats[0].position.x), get_discrete_Y(player.position.y), get_discrete_X(player.position.x))) {
      check_edge_case = true;   //be on alert
    }

    if(player_observed) {
      updateStateHistory(stateHistory, state_Index, maxHistory);

      if(observed_frequency % 10 === 0) {
        saved_state_index = state_Index;
      }
    }
    

    old_cat_distance = new_cat_distance;    //SAVE THIS VALUE FOR NEXT ITERATION
    old_exit_distance = new_exit_distance;  

    if(TESTING && (restart || restart2)) {
      //testing phase means we do not change epsilon
      if(restart2) {
        total_escape_paths += path_count;
        testing_success += 1;
      }
      else {
        total_caught_paths += path_count;
      }

      TESTING_EPISODES += 1
      myCats[0].rows = [];
      myCats[0].col = [];
      let positions = selectFreePositions(map);

      //reset agent positions
      player.position.y = get_continuous_X(positions.mousePosition.row) 
      player.position.x = get_continuous_Y(positions.mousePosition.col)    
      myCats[0].position.y = get_continuous_X(positions.catPosition.row) 
      myCats[0].position.x = get_continuous_Y(positions.catPosition.col) 

      if(TESTING_EPISODES % 200 === 0) {

        total_path_length.push((total_escape_paths + total_caught_paths) / 200);

        testing_success = 0;
      }
      path_count = 0;   //counting number of paths taken
    }
    // -----------------------------------------------------------------------------
  }

  

}
